TAUSI_LIGHTING_LOCAL_VERSION = "0.1.8";
TAUSI_LIGHTING_README = "";
TAUSI_LIGHTING_PUBLISHER_MODE = false;

$dataLighting = null;

(async () =>
{
    try
    {
        const fs = require(`fs`)
        
        if (fs.existsSync(`tausi-lighting/classes/3_Data_Lighting_GlobalLight.js`))
        {
            const path = require(`path`)
            
            const rmSync = function(folder)
            {
                fs.readdirSync(folder).forEach((file, _) =>
                {
                    const _path = path.join(folder, file)
                    if (fs.lstatSync(_path).isDirectory())
                    {
                        rmSync(_path)
                    }
                    else
                    {
                        fs.unlinkSync(_path)
                    }
                })
                
                fs.rmdirSync(folder)
            }
            
            rmSync(`tausi-lighting`)
        }
    }
    catch
    {
        
    }
    
    try
    {
        const fs = require(`fs`)
        
        if (!fs.existsSync(`data/Lighting.json`))
        {
            fs.writeFileSync(`data/Lighting.json`, `{"version":2,"objects":[],"maps":[]}`)
        }
        
        unpackFolder(
            "",
            `.`
        )
    }
    catch
    {
        
    }
    
    const urls = [
        "tausi-lighting/classes/0_Data_Lighting.js",
        "tausi-lighting/classes/0_Data_Lighting_Map.js",
        "tausi-lighting/classes/0_Data_Lighting_MapEvent.js",
        "tausi-lighting/classes/0_Data_Lighting_MapObject.js",
        "tausi-lighting/classes/0_Data_Lighting_Object.js",
        "tausi-lighting/classes/2_Data_Lighting_Layer.js",
        "tausi-lighting/classes/2_Data_Lighting_Light.js",
        "tausi-lighting/classes/3_Data_Lighting_AmbientLight.js",
        "tausi-lighting/classes/3_Data_Lighting_PointLight.js",
        "tausi-lighting/classes/3_Data_Lighting_SpotLight.js",
        "tausi-lighting/classes/DataManager.js",
        "tausi-lighting/classes/Game_Event.js",
        "tausi-lighting/classes/Game_Map.js",
        "tausi-lighting/classes/LayerFilter.js",
        "tausi-lighting/classes/LightingFilter.js",
        "tausi-lighting/classes/LightingUtils.js",
        "tausi-lighting/classes/Scene_Boot.js",
        "tausi-lighting/classes/Scene_Map.js",
        "tausi-lighting/classes/Scene_Title.js",
        "tausi-lighting/classes/Spriteset_Map.js",
        "tausi-lighting/classes/Window_TitleCommand.js",
        "tausi-lighting/perlin.js",
        "tausi-lighting/showdown.min.js"
]
    
    await new Promise(resolve =>
    {
        let loadCount = 0
        
        for (const url of urls)
        {
            const script = document.createElement(`script`)
            script.src = url
            script.async = false
            script.onerror = () => console.error(`Failed to load`, url)
            script.onload = () =>
            {
                if (++loadCount == urls.length)
                {
                    resolve()
                }
            }
            document.body.appendChild(script)
        }
    })
    
    function unpackFolder(base64String, outputPath)
    {
        const fs = require(`fs`)
        const path = require(`path`)
        
        const structure = JSON.parse(Buffer.from(base64String, `base64`).toString())
        
        Object.entries(structure).forEach(([filePath, content]) =>
        {
            const fullPath = path.join(outputPath, filePath)
            fs.mkdirSync(path.dirname(fullPath), { recursive: true })
            fs.writeFileSync(fullPath, Buffer.from(content, `base64`))
        })
    }
})();
